<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8">
    <title></title>
    <style>
        .intrinsic-container {
        position: relative;
        height: 0;
        overflow: hidden;
      }

      /* 16x9 Aspect Ratio */
      .intrinsic-container-16x9 {
        padding-bottom: 56.25%;
      }

      /* 4x3 Aspect Ratio */
      .intrinsic-container-4x3 {
        padding-bottom: 75%;
      }

      .intrinsic-container iframe {
        position: absolute;
        top:0;
        left: 0;
        width: 100%;
        height: 100%;
      }
    </style>
  </head>
  <body>
    <div class="intrinsic-container">
      <iframe src="https://app.powerbi.com/view?r=eyJrIjoiYTQ4ZWFhMWEtNTI5Yy00YjAxL
      ThlOTAtZGY0ODQyY2ZhNDRiIiwidCI6IjkyMzEzNWM0LWY1MjQtNDBhYy04MWIzLTAyZjhlZWJkMm
      FiMSJ9" width=90% height=850></iframe>
    </div>
  </body>
</html>
